import React, { useState, useEffect } from "react";
import axios from "axios";
import { Card, Button, Col } from "react-bootstrap";

const API_URL = "https://us-real-estate.p.rapidapi.com/v2/property-detail";

const PropertyCards = () => {
  const [properties, setProperties] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios
      .get(API_URL, {
        method: "GET",
        url: "https://us-real-estate.p.rapidapi.com/v2/property-detail",
        params: { property_id: "3199790641" },
        headers: {
          "X-RapidAPI-Key":
            "e8e6d1cb20msh3c038ddf785e626p1a61ccjsn3f1d9d72ccb6",
          "X-RapidAPI-Host": "us-real-estate.p.rapidapi.com",
        },
      })
      .then((response) => {
        setProperties(response.data);
        setLoading(false);
      })
      .catch((error) => {
        console.log(error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <p>Loading properties...</p>;
  }

  return (
    <div className="container">
      <div className="row">
        {properties.map((property) => (
          <div key={property.id} className="col-md-4 mb-3">
            <Card>
              <Col>
                <Card.Body>
                  <Card.Title>{property.address.fullAddress}</Card.Title>
                  <Card.Text>{property.description}</Card.Text>
                  <ul>
                    <li>Price: {property.address}</li>
                    <li>Beds: {property.beds}</li>
                    <li>Baths: {property.county}</li>
                    <li>Square footage: {property.sqft}</li>
                  </ul>
                  <Button variant="primary">View Property</Button>
                </Card.Body>
              </Col>
            </Card>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PropertyCards;
